import React, { Component } from 'react';

import './App.css';

const currencies: string[] = [ 'EUR', 'PLN', 'GEL', 'DKK', 'CZK', 'GBP', 'SEK', 'USD', 'RUB' ];

const App: React.FC<{
	curr: string[];
	itemCheck: (item: string) => void;
}> = ({ curr }) => {
	return (
		<div>
			{currencies.map((item: string, index: number) => (
				<div key={index}>
					<label>
						<input />
					</label>
				</div>
			))}
		</div>
	);
};

export default App;
